import React, {useState,useEffect}from 'react';
import classes from "./MainPage.module.sass";
import Header from '../components/Header';
import videoMain from '../images/video-main.mp4'

const MainPage = () => {
    return (
        <div className={classes.Main}>
            <Header/>
            <div className={classes.Main__}>
                <video className={classes.Main} src={videoMain} autoplay muted loop></video>
            </div>
        </div>
    );
};
export default MainPage;
